def urshift(val, n): return (val % 0x100000000) >> n

def floatstr_fmt(float_arr):
  if len(float_arr) == 0:
    return "(empty)"

  return "(" + ",".join(["%.2f" % f for f in float_arr]) + ")"

def str_swizzle(str_):
  swiz = ""
  i2 = 0
  while i2 < len(str_):
    i3 = i2 + 1
    i4 = 1
    while i3 < len(str_) and str_[i2] == str_[i3]:
      i4 += 1
      i3 += 1
    if i4 > 1:
      swiz += str(i4)
    swiz += str_[i2]
    i2 = i3

  return swiz

def str_hash(str_):
  j2 = 0
  for i2 in range(len(str_)):
    j3 = urshift(j2, 8)
    shiftidx = ((255 & j2) ^ (ord(str_[i2])))
    j2 = j3 ^ str_hash_shifts[shiftidx]
  return j2

def quant(float_arr):
  f2 = min(float_arr)
  f3 = max(float_arr)
  f4 = (f3 - f2) / 60.0
  str_ = ''
  for i2 in range(len(float_arr)):
    d = float_arr[i2] - f2
    if f4 != 0:
      floor = chr(int(d // f4) + 65)
    else:
      floor = chr(65)

    if float_arr[i2] == f3:
      floor = '}'
    if floor == '\\':
      floor = '.'
    elif floor == '.':
      floor = '\\'
    str_ += floor

  return str_

def quant_sum(float_arr):
  s=str_hash(str_swizzle(quant(float_arr)))
  return s+round(min(float_arr)*100.0 + max(float_arr)*100.0)

def feistel_trip(i2, i3, i4):
  return feistel(((i3 & 4294967295) | (i2 << 32)), i4)

def feistel(j2, i2):
  i3 = toSigned32(j2)
  i4 = toSigned32(j2 >> 32)
  i5 = 0
  while i5 < 16:
    i6 = i3
    i3 = i4 ^ feistel_helper(i3, i2, i5)
    i4 = i6
    i5 += 1
  return ((i4 << 32) | (i3 & 4294967295))

def feistel_helper(i2, i3, i4):
  return i2 ^ ((urshift(i3, 32 - i4)) | (i3 << i4))

def toSigned32(n):
    n = n & 0xffffffff
    return (n ^ 0x80000000) - 0x80000000

