def sign_sensor(sensor):
  import Crypto
  from Crypto.Cipher import PKCS1_v1_5, AES
  from Crypto.PublicKey import RSA
  from base64 import b64decode, b64encode
  from Crypto.Util.Padding import pad
  import hashlib
  import struct
  import hmac

  aeskey = secrets.token_bytes(16)
  mackey = secrets.token_bytes(32)
  pkey = RSA.import_key(b64decode(PKEY))
  aesKeyEnc = b64encode(PKCS1_v1_5.new(pkey).encrypt(aeskey))
  macKeyEnc = b64encode(PKCS1_v1_5.new(pkey).encrypt(mackey))

  aes = AES.new(aeskey, AES.MODE_CBC)
  doFinal = aes.encrypt(pad(sensor.encode(), AES.block_size))
  combo = aes.iv + doFinal
  doFinal2 = hmac.new(mackey, combo, digestmod=hashlib.sha256).digest()

  finalEnc = b64encode(combo + doFinal2)

  return f"1,a,{aesKeyEnc.decode()},{macKeyEnc.decode()}${finalEnc.decode()}$0,0,0"

