def gen_quant(vals):
  q = quant(vals)
  return {
    'min': "%.02f" % min(vals), 'max': "%.02f" % max(vals),
    'sampleHash': str(str_hash(str_swizzle(q))),
    'quantStr': q
  }
def gen(package, sd_base=None):
  if sd_base is None:
    idx = random.randrange(0, len(SDS))
    sd_base = SDS[idx]
  # print(idx)
  base = parse(sd_base)

  # device = DEVICES[0]
  device = random.choice(DEVICES)
  print(device)
  base['is_adb_enabled'] = '0'
  base['device_height'] = device['height']
  base['device_width'] = device['width']
  base['build_display'] = device['Build.DISPLAY']
  base['build_manufacturer'] = device['Build.MANUFACTURER']
  base['build_version_release'] = device['Build.VERSION.RELEASE']
  base['build_version_codename'] = device['Build.VERSION.CODENAME']
  base['build_version_incremental'] = device['Build.VERSION.INCREMENTAL']
  base['build_version_sdk_int'] = device['Build.VERSION.SDK_INT']
  base['build_product'] = device['Build.PRODUCT']
  base['build_tags'] = device['Build.TAGS']
  base['build_type'] = device['Build.TYPE']
  base['build_user'] = device['Build.USER']
  base['build_display'] = device['Build.DISPLAY']
  base['build_board'] = device['Build.BOARD']
  base['build_brand'] = device['Build.BRAND']
  base['build_device'] = device['Build.DEVICE']
  base['build_fingerprint'] = device['Build.FINGERPRINT'].replace('\\', '')
  base['build_host'] = device['Build.HOST']
  base['build_id'] = device['Build.ID']
  base['build_model'] = device['Build.MODEL']
  base['build_bootloader'] = device['Build.BOOTLOADER']
  base['build_hardware'] = device['Build.HARDWARE']
  for k in base:
    if k[:5] == 'build':
      base[k] = base[k].replace(' ', r'%20')


  base['package'] = package
  base['randint'] = str(random.randrange(-2**31 + 1, 2**31-1))
  base['android_id'] = secrets.token_hex(8)
  base['firebase_analytics_level'] = str(random.randrange(1, 100))
  base['perf_0'] = str(random.randrange(13, 19))
  base['perf_1'] = str(random.randrange(140, 2632))
  base['perf_3'] = str(random.randrange(116, 5265))
  base['perf_4'] = str(100 * random.randrange(46, 3689))
  base['perf_5'] = str(random.randrange(54, 3697))
  base['perf_6'] = str(100 * random.randrange(92, 1451))
  base['perf_7'] = str(random.randrange(91, 1450))
  base['perf_8'] = str(random.randrange(5345, 15198))
  base['v.p*1000'] = str(1000 * random.randrange(1, 60))
  base['sensor_uptime_dt'] = str(1000 * random.randrange(1000, 2745))
